import React, {Component, Fragment} from 'react';
import {Navigate} from '../App';
import {
    Divider,
    Typography,
    Button,
    List,
    ListItem,
    ListItemText,
    LinearProgress
} from '@material-ui/core';
import logo from '../goodness.png';

interface HomeScreenProps {
    navigate: Navigate;
    challenges: string[];
}

interface HomeScreenState {}

export class HomeScreen extends Component<HomeScreenProps, HomeScreenState> {
    constructor(props: HomeScreenProps) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div style={{padding: '8px', display: 'flex', flex: 1, flexDirection: 'column'}}>
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                >
                    <img src={logo} style={{width: '20ch'}} />
                    <Button onClick={() => this.props.navigate('DailyCheckIn')}>
                        Daily Check In
                    </Button>
                </div>
                <Typography variant='h5'>Today's Challenges</Typography>
                <List dense>
                    {this.props.challenges.map(challenge => (
                        <ListItem button>
                            <ListItemText>{challenge}</ListItemText>
                        </ListItem>
                    ))}
                </List>
                <Divider/>
                <Typography variant='h5'>Progress Overview</Typography>
                <LinearProgress variant='determinate' value={50} style={{margin: '2px 8px'}}/>
            </div>
        );
    }
}
